  return (
    <div className="home">
      <Link to="/login">
        <Button variant="contained" color="primary">
          Login
      </Button>
      </Link>
      <br />
      <Link to="/order">
        <Button variant="contained" color="primary">
          Order
      </Button>
      </Link>
    </div>
  );
}

